import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Settings.module.css";

const Settings = (props) => {
  // const changeLanguage = (e) => {
  //   return (e) => {
  //     var ln = e.target.value;
  //     console.log(ln);
  //   };
  // };
  const changeLanguage = (e) => {
    var ln = document.getElementById("select").value;
    console.log(ln);
  };

  return (
    <div className={s.settings}>
      <NavLink className={s.header} to="/shop">
        <div className={s.back}>
          <span></span>
        </div>
        <div className={s.text}>Settings</div>
      </NavLink>
      <div className={s.language}>
        <div className={s.lText}>Language</div>
        <form>
          <select
            className={s.select}
            id="select"
            name="language"
            onChange={changeLanguage()}
          >
            <option value="en" onChange={() => changeLanguage()}>
              English
            </option>
            <option value="Default">Default</option>
            <option value="ru" onClick={changeLanguage}>
              Russia
            </option>
          </select>
        </form>
      </div>
    </div>
  );
};

export default Settings;
